sys_variable_value.value:
(function execute(inputs, outputs) {
		var gr = new GlideRecord('sc_req_item');
		gr.get(inputs.RITMDocumentID.toString());

		var requestedItemUtils = new global.RequestedItemUtils();
		var catItemVars = requestedItemUtils.getVariablesHTML(gr);
		outputs.variablesstring = catItemVars;
})(inputs, outputs);

